import React from 'react';
import { Link } from 'react-router-dom';
import './App.css'; // CSSファイルのインポート

export const Header = ({ isLoggedIn }) => {
  return (
    <header className='header-wrapper'>
      <div><Link to='/' className='link-top'>Forsteri</Link></div>
      {isLoggedIn ? (
        <div>
        <div><Link to='/theme' className='links'>Theme</Link></div>
        <div><Link to='/auth/logout' className='links'>Logout</Link></div>
        </div>
      ) : (
        <div><Link to='/auth/login' className='links'>Login</Link></div>
      )}
       <div><Link to='/auth/signup' className='links'>Signup</Link></div>
    </header>
  );
};
